    content: "<?xml version=\"1.0\" encoding=\"utf-8\" ?>\n<rsp stat=\"ok\">\n<person
      id=\"61270229@N05\" nsid=\"61270229@N05\" ispro=\"1\" is_deleted=\"0\" iconserver=\"65535\"
      iconfarm=\"66\" path_alias=\"navymedicine\" has_stats=\"0\" pro_badge=\"standard\"
      expire=\"1982894400\" has_adfree=\"0\" has_free_standard_shipping=\"0\" has_free_educational_resources=\"0\">\n\t<username>NavyMedicine</username>\n\t<realname>Navy
      Medicine</realname>\n\t<location>Washington, DC, USA</location>\n\t<timezone
      label=\"Eastern Time (US &amp; Canada)\" offset=\"-05:00\" timezone_id=\"EST5EDT\"
      timezone=\"14\" />\n\t<description>Official Flickr page of U.S. Navy Medicine
      &amp;amp; its headquarters, the Bureau of Medicine and Surgery (BUMED). Please
      send questions to michael.g.rhode2.civ@health.mil and read an interview about
      the collection at &lt;a href=&quot;https://www.flickr.org/navy-medicine-on-flickr-commons/&quot;
      rel=&quot;noreferrer nofollow&quot;&gt;www.flickr.org/navy-medicine-on-flickr-commons/&lt;/a&gt;\n\nDocuments
      and other files can be viewed at the Medical Heritage Library - &lt;a href=&quot;https://archive.org/details/usnavybumedhistoryoffice&quot;
      rel=&quot;noreferrer nofollow&quot;&gt;archive.org/details/usnavybumedhistoryoffice&lt;/a&gt;
      . Our Facebook page is &lt;a href=&quot;https://www.facebook.com/USNavyMedicine&quot;
      rel=&quot;noreferrer nofollow&quot;&gt;www.facebook.com/USNavyMedicine&lt;/a&gt;\n\nNavy
      Medicine is an integral part of today\u2019s Navy and Marine Corps team and
      has been a part of that team since the American Revolution. Today\u2019s Navy
      and Marine Corps team is engaged in a global power competition. Our country
      depends upon Navy Medicine\u2019s unique expeditionary medical expertise to
      prepare and support Naval forces, including both Navy and Marine forces. This
      renewed global power competition requires Navy Medicine to be more agile and
      capable of operating in a distributed maritime environment at the speed of our
      warfighters. The Navy-Marine Corps team\u2019s ability to prevail across the
      range of military operations is dependent upon their medical readiness and our
      ability to enhance their survival in the high-end fight. Today\u2019s Navy Medicine
      is built on the shoulders of those who came before us, including everything
      from shipboard and submarine medicine to research and development on the cutting
      edge of medical science. Items in this collection include both current and historical
      photos illustrating Navy Medicine\u2019s role in the defense of the United States
      of America. \n\nNavy Medicine participates in The Commons on Flickr to further
      its educational mission and to increase public access to its collections of
      images.\n\nNavy Medicine&#039;s images that are part of The Commons on Flickr
      are marked &amp;quot;no known copyright restrictions.&amp;quot; This means that
      we are unaware of any current copyright restrictions on the works so designated,
      either because the term of copyright may have expired without being renewed,
      because no evidence has been found that copyright restrictions apply, or because
      the work has been prepared by and officer of employee of the United States Government
      as part of that person\u2019s official duties and is not subject to copyright
      protection in the United States.\n\nNavy Medicine&#039;s website is &lt;a href=&quot;https://www.med.navy.mil/&quot;
      rel=&quot;noreferrer nofollow&quot;&gt;www.med.navy.mil/&lt;/a&gt;\n\nContributors:\n\nThe
      Navy Bureau of Medicine and Surgery (BUMED) is the headquarters for the Navy
      Medicine enterprise. Under the leadership of Rear Adm. Bruce Gillingham, Navy
      surgeon general and chief, BUMED, Navy Medicine ensures Sailors, Marines and
      their families and retirees are healthy, ready and on the job \u2013 be it on
      land or sea.\n\nBUMED&#039;s Office of Medical History. A historical component
      has existed at the US Navy&#039;s Bureau of Medicine and Surgery since May 1907
      with the establishment of the Publications Office. In addition to producing
      The Naval Medical Bulletin, the Publications Office was responsible for producing
      occasional historical monographs, and maintaining a historical archive. Today
      the Office of Medical History&#039;s mission has evolved to preserve and promote
      the history and heritage of the Navy Medical Department while serving the needs
      of our customers. The collection consists of publications, public records, manuscripts,
      personal papers, hospital plans, Navy Hygiene Museum records, biographical files,
      subject files, facility files, films, videos, photographs, prints, drawings,
      and artifacts. The OMH currently consists of over 100 collections covering over
      1,000 linear feet and is staffed by a historian and an archivist. Non-photographic
      items from the BUMED&#039;s historian&#039;s office can be found on the Medical
      Heritage Library at &lt;a href=&quot;https://archive.org/details/usnavybumedhistoryoffice&quot;
      rel=&quot;noreferrer nofollow&quot;&gt;archive.org/details/usnavybumedhistoryoffice&lt;/a&gt;\n\nNaval
      Hospital Bremerton (NHB) is a community-based acute care and obstetrical hospital,
      offering expert primary care, urgent care and a broad range of medical and surgical
      specialties, with 23 inpatient beds.  NHB is parent command for three branch
      health clinics located at Puget Sound Naval Shipyard, NBK Bangor and Naval Station
      Everett.   Naval Hospital Bremerton and its clinic&#039;s staff consist of approximately
      1,400 dedicated military, civilian, contract and American Red Cross volunteer
      personnel.  As partners in the Puget Sound Military Health System, along with
      TRICARE West region, Naval Hospital Bremerton&#039;s dedicated staff, along
      with the managed care support contractor, Health Net Federal Services provides
      timely, and quality care to the over 80,000 eligible individuals residing within
      the Puget Sound. NHB&#039;s home page is &lt;a href=&quot;https://www.med.navy.mil/sites/nhbrem/Pages/Default.aspx&quot;
      rel=&quot;noreferrer nofollow&quot;&gt;www.med.navy.mil/sites/nhbrem/Pages/Default.aspx&lt;/a&gt;\n\nThe
      Naval Health Research Center (NHRC) optimizes the operational readiness and
      health of our armed forces by conducting research, development, testing, and
      evaluation to inform Department of Defense (DoD) policy. We have been designated
      the DoD Deployment Health Research Center since 1999. We conduct science that
      spans the spectrum from physical readiness to joint medical planning, to wounded
      warrior recovery and behavioral health interventions, all focusing on the health,
      readiness, and well-being of our nation\u2019s military members and their families.
      We conduct research that is operationally relevant and driven by fleet requirements.
      Our core research areas include Operational Readiness and Health, Military Population
      Health, and Operational Infectious Diseases. We are one of eight laboratories
      affiliated with the Naval Medical Research Center in Silver Spring, Maryland,
      within the U.S. Navy Bureau of Medicine and Surgery. Together, we support military
      mission readiness with research and development that delivers high-value, high-impact
      solutions to the health and readiness challenges our military population faces
      on the battlefield, at sea, on foreign shores, and at home. NHRC&#039;s homepage
      is at &lt;a href=&quot;https://www.med.navy.mil/sites/nmrc/nhrc/Pages/default.aspx&quot;
      rel=&quot;noreferrer nofollow&quot;&gt;www.med.navy.mil/sites/nmrc/nhrc/Pages/default.aspx&lt;/a&gt;</description>\n\t<photosurl>https://www.flickr.com/photos/navymedicine/</photosurl>\n\t<profileurl>https://www.flickr.com/people/navymedicine/</profileurl>\n\t<mobileurl>https://m.flickr.com/photostream.gne?id=61264889</mobileurl>\n\t<photos>\n\t\t<firstdatetaken>0000-00-00
      00:00:00</firstdatetaken>\n\t\t<firstdate>1301670130</firstdate>\n\t\t<count>24870</count>\n\t</photos>\n</person>\n</rsp>\n"
