      height_l=\"866\" width_l=\"1024\">\n\t\t<description>Making big steps in foot
      care at Naval Hospital Bremerton\u2026 Lt. Edee Renier, staff podiatrist assigned
      to NHB\u2019s Orthopedic department shares her expertise in handling foot and
      ankle specific medical conditions, such as ankle sprains and strains, stress
      fractures, plantar fasciitis, shin splints, blisters, bunions, corns, calluses
      and ingrown toenails. Wear and tear can also cause arthritis and tendonitis.
      \u201CEach foot has 28 bones, 33 joints, 29 muscles and over 30 ligaments,\u201D
      explained Renier. For those who might be unsure or uncertain when an appointment
      should be made to see a podiatrist, Renier has a prompt answer.  \u201CWhen
      your feet hurt! If you had an injury, you never fully recovered, or if something
      on your feet just doesn\u2019t feel the way it used to, I\u2019m happy to take
      a look! I\u2019m always happy to see acute injuries as well, like ankle sprains,
      broken toes etc.,\u201D exclaimed Renier (Official Navy photo by Douglas H Stutz,
      NHB/NMRTC Bremerton public affairs officer).\n&lt;a href=&quot;https://www.dvidshub.net/news/460364/making-feats-feet-with-naval-hospital-bremertons-podiatrist&quot;
      rel=&quot;noreferrer nofollow&quot;&gt;www.dvidshub.net/news/460364/making-feats-feet-with-naval...&lt;/a&gt;</description>\n\t</photo>\n\t<photo
